INSERT INTO `easyii_carousel` VALUES (1,'/uploads/carousel/zastita-a4768c240c.jpg','','STIHL ADVANCE X-Light zaštitna odjeća','Schoffel razvio te proizveo ekskluzivno za STIHL, izuzetno elastične brzo se suše i griju. Vodo nepropusne otporne na habanje.',2,1),(2,'/uploads/carousel/pila-18e1756921.jpg','','Kupite jednom imate zauvijek','Visoko kvalitetne pile sa novim 2 MIX motorima te HD2 filterima i M-tronic sustavom upravo STIHL čini izvanrednim proizvodom',3,1),(3,'/uploads/carousel/pribor-9f50a5b5a5.jpg','','STIHL lanci, vodilice te turpije visoke kvalitetne izrade','Potražite originalni STIHL potrošni materijal lanaca vodilica te pribora za oštrenje reznih garnitura koji ne može niti jedan drugi zamjeniti.',4,1),(4,'/uploads/carousel/a-a34f440683.jpg','','Osobna zaštita i oprema','Obavljanje posla najbolje je sa Stihl opremom. Imamo ne samo najbolju opremu i materijal za posao, nego i odgovarajuću osobnu zaštitnu opremu za sve potrebe: Potpunu zaštitu za oči, uši i glavu, zaštitna odjeća otporna na rezove, prozračna radna odjela, udobne rukavice, te udobna i čvrsta obuća. Sa ugodnošću naše zaštitne opreme krenite u nove radne pobjede!',1,1);
