metrom.</p>',1,1000,NULL,'{\"tezina-kg\":\"5\",\"zapremnina-spremnika-l\":\"18\"}','/uploads/catalog/sg71-6186178f4a.jpg','sg-71',1502871277,1),(108,20,'TS 410','<p>Kompaktan i robustan brusni parač opremljen inovativnim sustavom predpročišćavanja zraka za hlađenje i sustavom predčišćenja zraka za izradu mješavine Zyklon. Zahvaljujući Zyklon sustavu pročistač zraka zahtijeva neusporedivo rjeđe čišćenje. Zadovoljava standarde o emisijama štetnih ispušnih plinova EPA II i EU II. Precizan sustav vođenja i upravljanja strojem omogućava rad sa znatno manje vibracija. ElastoStart, kompenzator i ventil za dekompresiju u serijskoj su opremi stroja. Zatvarač spremnika goriva ne zatvara pomoću navoja, već pomoću inovativnog \"Bajonet\" preklopnog nasjeda. Prilagođen za rad iz ruke kao i za rezanje sa vodećih kolica FW 20.</p>',1,8125,NULL,'{\"zapremina-cm\":\"66.7\",\"snaga-kw-ks\":\"3.2 \\/ 4.4\",\"tezina-kg\":\"9.4\",\"razina-zvucnog-tlaka-db-a\":\"98\",\"razina-zvucne-snage-db-a\":\"109\",\"razina-vibracija-lijevo-desno-m-s\":\"3.9 \\/ 3.9\",\"promjer-rezne-ploce-mm\":\"300\",\"najveca-dubina-reza-mm\":\"100\",\"ukupna-duljina-cm\":\"67.5\",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\"}','/uploads/catalog/ts410-119e18e766.jpg','ts-410',1502872701,1),(109,20,'TS 420','<p>Lagan i praktičan brusni parač 3,2 kW opremljen višenamjenskom brusnom pločom promjera 350 mm. Opremljen inovativnim sustavom pročišćavanja zraka velikog intervala čišćenja, te Zyklon sistemom uklanjnja prašine. Antivibracijski sustav brine se za uštedu snage i udoban rad. Uobličen za rad iz ruke ili sa vodećih kolica FW 20.1</p>',1,9250,NULL,'{\"zapremina-cm\":\"66.7\",\"snaga-kw-ks\":\"3.2 \\/ 4.4\",\"tezina-kg\":\"10.1\",\"razina-zvucnog-tlaka-db-a\":\"98\",\"razina-zvucne-snage-db-a\":\"109\",\"razina-vibracija-lijevo-desno-m-s\":\"3.9 \\/ 3.9\",\"promjer-rezne-ploce-mm\":\"350\",\"najveca-dub