-db-a\":\"109\",\"razina-vibracija-lijevo-desno-m-s\":\"7.2 \\/ 7.2\"}','/uploads/catalog/km94-6df3e46586.jpg','km-94r-c-e',1502875347,1),(118,22,'KM 55','<p>Kombi motor dovoljne snage za nastavak za košnju.</p>',1,2541,NULL,'{\"zapremina-cm\":\"27.2\",\"snaga-kw-ks\":\"0.75 \\/ 1\",\"tezina-kg\":\"4.4\",\"duljina-na-naglavni-cm\":\"\",\"razina-zvucnog-tlaka-db-a\":\"95\",\"razina-zvucne-snage-db-a\":\"109\",\"razina-vibracija-lijevo-desno-m-s\":\"4.5 \\/ 4\"}','/uploads/catalog/km55-844f0d9a0c.jpg','km-55',1502875574,1),(119,22,'MM 55','<p>MultiSystem. Jednostavan za transport i spremanje zahvaljujući sklopivom okviru i ovjesnoj ušici.Ergonomski pozicionirane kontrole. Različiti alati za njegu travnjaka, pripremu tla i čišćenje raznih površina mogu se zamijeniti bez alata u tren oka.</p>',1,3750,NULL,'{\"zapremina-cm\":\"27.2\",\"snaga-kw-ks\":\"0.75 \\/ 1\",\"tezina-kg\":\"7.9\",\"duljina-na-naglavni-cm\":\"\",\"razina-zvucnog-tlaka-db-a\":\"92\",\"razina-zvucne-snage-db-a\":\"102\",\"razina-vibracija-lijevo-desno-m-s\":\"2.4 \\/ 3.6\"}','/uploads/catalog/m55-8054cd43b9.jpg','mm-55',1502875795,1),(120,23,'BF-KM','<p>Freza za tlo za KombiSystem koristi se za prorahljivanje i kultiviranje tla, usitnjavanje gruda zemlje, te prozračivanje srednje tvrdog i tvrdog tla. Pogodna je za pripremu tla za sadnju manjih biljaka. Težina: 4,1 kg.Ukupna dužina: 103 cm. Pogodno za korištenje s Kombi motorm i FR 130 T.</p>',1,2187,NULL,'{\"orude\":\"Freza\",\"radna-sirina-cm\":\"22\",\"tezina-kg\":\"4.1\",\"ukupna-duzina-cm\":\"100\"}','/uploads/catalog/bfkm-837067f8a7.jpg','bf-km',1502876194,1),(121,23,'BG-KM','<p>Puhač za KombiSystem odlikuje se malom masom i velikom snagom puhanja. Pogodan je za uklanjanje nečistoće, lišća, ostataka otkosa ili snijega. Težina: 1,8 kg.Duljina 89 cm.Pogodno za Kombi motor i FR 130 T.</p>',1,1125,NULL,'{\"orude\":\"Puha\\u010d\",\"radna-sirina-cm\":\"\",\"tezina-kg\":\"1.9\",\"ukupna-duzina-cm\":\"89\"}','/uploads/catalog/bgkm-ae350a6630.jpg','bg-km',1502876274,1),(122,23,'FCB-KM','<p>Rezač bridova travnjaka za KombiSystem, sa savijenom cijevi. Za precizno uređivanje rubova travnjaka i uz staze kroz zelene površine. Težina: 2,3 kg.Ukupna duljina: 92cm.Pogodan za korištenje s Kombi motorom i FR 130 T.</p>',1,937,NULL,'{\"orude\":\"Reza\\u010d bridova\",\"radna-sirina-cm\":\"\",\"tezina-kg\":\"2.3\",\"ukupna-duzina-cm\":\"92 (savijena cijev)\"}','/uploads/catalog/fcbkm-b8526751c2.jpg','fcb-km',1502876365,1),(123,23,'FH-KM','<p>Rezač šipražja za KombiSystem s varijabilnim kutem pogodan je za šišanje grmlja i košnju u skučenim prostorima. Idealan za uređivanje parkova, parkirnih mjesta ili kružnih tokova. Težina: 2,4 kg. Ukupna dužina: 133 cm.Pogodno za korištenje s Kombi motorom i FR 130 T.</p>',1,2164,NULL,'{\"orude\":\"Reza\\u010d \\u0161ipra\\u017eja\",\"radna-sirina-cm\":\"\",\"tezina-kg\":\"2.4\",\"ukupna-duzina-cm\":\"133\"}','/uploads/catalog/fhkm-845fa6582f.jpg','fh-km',1502876458,1),(124,23,'FS-KM','<p>Priključak za košnju za KombiSystem s glavom za košnju AutoCut C 25-2. Idealan za košnju manjih površina i završne radove košnje uz rubove travnjaka. Težina: 1.2 kg. Ukupna duljina: 94cm. Pogodno za korištenje s Kombi motorom i FR 130 T.</p>',1,1125,NULL,'{\"orude\":\"Glava za ko\\u0161nju AutoCut 25-2\",\"radna-sirina-cm\":\"420\",\"tezina-kg\":\"1.2\",\"ukupna-duzina-cm\":\"94\"}','/uploads/catalog/fskm-5d72a981f8.jpg','fs-km',1502876550,1),(125,23,'HL-KM','<p>Škare za živicu za KombiSystem u ravnoj izvedbi pogodne su za šišanje visokih živica i niveliranje širokih pojaseva žive ograde. Težina: 2,3 kg.Ukupna duljina: 118cm. Pogodno za Kombi motor i FR 130T.</p>',1,1755,NULL,'{\"orude\":\"\\u0160kare za \\u017eivicu \",\"radna-sirina-cm\":\"\",\"tezina-kg\":\"1.8\",\"ukupna-duzina-cm\":\"116\"}','/uploads/catalog/hlkm-74b74d5522.jpg','hl-km',1502876657,1),(126,23,'HL-KM 135','<p>Škare za živicu za KombiSystem s varijabilnim kutem nagiba noževa (do 135°) Pogodne su za oblikovanje žive ograde s mogućnošću p