 tla za sadnju manjih biljaka.</p>',1,562,NULL,'{\"orude\":\"Freze za tlo\",\"tezina-kg\":\"2\",\"radna-sirina-cm\":\"23\"}','/uploads/catalog/bfmm-aac84905a2.jpg','bf-mm',1502877451,1),(131,24,'BK-MM','<p>Set noževa za kopanje BK-MM koristi se za kopanje sipkog, ali i tvrdog tla, razbijanje gruda zemlje i okopavanje između biljaka.</p>',1,562,NULL,'{\"orude\":\"Set no\\u017eeva za kopanje\",\"tezina-kg\":\"2\",\"radna-sirina-cm\":\"21\"}','/uploads/catalog/bkmm-91188f993b.jpg','bk-mm',1502878963,1),(132,24,'FC-MM','<p>Rezač rubova travnjaka FC-MM koristi se za ograničavanje travnatih ploha, kao i za razbijanje zapletenog korijenja pri prozračivanju. Omogućava jasno obrubljivanje travnjaka.</p>',1,263,NULL,'{\"orude\":\"Reza\\u010d bridova\",\"tezina-kg\":\"0.8\",\"radna-sirina-cm\":\"\"}','/uploads/catalog/fcmm-f9782710bb.jpg','fc-mm',1502879029,1),(133,24,'KB-MM','<p>Okretna četka KB-MM čisti razmake među pločama i prirodnim kamenom na stazama, uklanja veće nečistoće i sasušeno blato. Smjer okretanja četki tjera pometenu nečistoću prema naprijed. Proširenje štitnika u serijskoj opremi.</p>',1,350,NULL,'{\"orude\":\"Okretna \\u010detka\",\"tezina-kg\":\"4.2\",\"radna-sirina-cm\":\"60\"}','/uploads/catalog/kbmm-037358e73a.jpg','kb-mm',1502879079,1),(134,24,'KW-MM','<p>Okretni valjak KW-MM čisti staze, ceste i prilaze od suhe i mokre nečistoće i otpada u građevinarstvu. Smjer okretanja valjka tjera nečistoću, vodu ili snijeg prema naprijed.</p>',1,2062,NULL,'{\"orude\":\"Okretni valjak \",\"tezina-kg\":\"3.9\",\"radna-sirina-cm\":\"60\"}','/uploads/catalog/kwmm-7c57a12e32.jpg','kw-mm',1502879463,1),(135,24,'MF-MM','<p>Odstranjivač mahovine MF-MM temeljito uklanja mahovinu i ostatke otkosa s travnjaka. Deflektor u serijskoj opremi.</p>',1,1500,NULL,'{\"orude\":\"Odstranjiva\\u010d mahovine\",\"tezina-kg\":\"8.6\",\"radna-sirina-cm\":\"50\"}','/uploads/catalog/mfmm-cf1513f37b.jpg','mf-mm',1502879556,1),(136,24,'RL-MM','<p>Prozračivač travnjaka RL-MM ravnomjerno prozračuje gornji sloj travnjaka, čime trava dobiva dovoljno zraka za disanje i razvoj. Time se razbijaju buseni trave, pa travnjak postaje homogen i ujednačen.</p>',1,500,NULL,'{\"orude\":\"Prozra\\u010diva\\u010d travnjaka\",\"tezina-kg\":\"2\",\"radna-sirina-cm\":\"23\"}','/uploads/catalog/rlmm-e808898936.jpg','rl-mm',1502879631,1),(137,26,'BT 45','<p>Ručni uređaj za bušenje sa snažnim benzinskim motorom. Idealan za bušenje rupa u drvetu do promjera 25 mm, u situacijama kada nemamo u blizini strujni priključak ili kada zbog niskih temperatura ne možemo raditi s akumulatorskom bušilicom. S ručkom, specijalnim adapterom, prigonom s dvije brzine i serijski ugrađenim hodom unazad za otpuštanje blokiranih svrdala. Sigurno startanje stroja u praznom hodu, bez pokretanja svrdla.</p>',1,4562,NULL,'{\"zapremnina-cm3\":\"27.2\",\"snaga-kwks\":\"0.8 \\/ 1.1\",\"tezina-kg\":\"4.8\",\"razina-zvucnog-tlaka-dba\":\"103\",\"razina-vibracija-lijevo-desno-m-s\":\"2.2 \\/ 2.5\",\"broj-okretaja-1min\":\"910 \\/ 2710\",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\"}','/uploads/catalog/btr-0e2a30999a.jpg','bt-45',1502880091,1),(138,26,'BT 130','<p>Uređaj za bušenje za jednog čovjeka s Quickstop kočnicom svrdla, za bušenje tla svrdlima do 200 mm promjera. Snažan STIHL 4-MIX ® motor s niskom emisijom štetnih plinova. QuickStop kočnica sazdana je tako da prilikom zapinjnja svrdla u tlu moment zakretanja uređaja aktivira kočnicu na način da  poluga za aktiviranje zapinje za tijelo poslužioca i trenutno zaustavlja prigon. Za razne poslove bušenja jednostavnih rupa u zemlji do uzimanja uzoraka tla.Bogat izbor svrdla za bušenje i dodatne opreme.Cijena bez svrdla.</p>',1,7725,NULL,'{\"zapremnina-cm3\":\"36.3\",\"snaga-kwks\":\"1.4 \\/ 1.9\",\"tezina-kg\":\"9.9\",\"razina-zvucnog-tlaka-dba\":\"92\",\"razina-vibracija-lijevo-desno-m-s\":\"1.5 \\/ 2.2\",\"broj-okretaja-1min\":\"200\",\"ovisno-