L Multi-Clean brišući sustav namijenjen je metenju različitih vrsta nečistoća. Četke su tako uobličene da učinkovito metu čak i u kutovima i oko rubnjaka. Spremnik nečistoće skida se u par jednostavnih koraka, zapremnine 25 l. Četke su načinjene od najlona otpornog na habanje, s 4 godine garancije.</p>',1,1812,NULL,'{\"radna-sirina\":\"55\",\"radni-ucinak-m-h\":\"1600\",\"zapremnina-spremnika-l\":\"25\",\"tezina-kg\":\"6\",\"za-podrucja-do-cca-m\":\"300\"}','/uploads/catalog/kg550-3a03ca0457.jpg','kg-550',1502881258,1),(142,28,'KG 770','<p>Snažan čistač za popločene površine do cca 1.500 metara kvadratnih.STIHL Multi-Clean PLUS sustav (2x tanjurasta četka + vodoravna valjkasta četka) namijenjen je za metenje različitih vrsta prljavštine. <span style=\"background-color: initial;\">Četke su tako uobličene da učinkovito metu čak i u kutovima i oko rubnjaka. Spremnik nečistoće skida se u par jednostavnih koraka, zapremnine 50 l. Četke su načinjene od najlona otpornog na habanje, s 4 godine garancije. Idealan za unutrašnje prostore poput skladišta i velikih garaža.</span></p>',1,4125,NULL,'{\"radna-sirina\":\"77\",\"radni-ucinak-m-h\":\"2900\",\"zapremnina-spremnika-l\":\"50\",\"tezina-kg\":\"13\",\"za-podrucja-do-cca-m\":\"1500\"}','/uploads/catalog/kg770-cc00d17f37.jpg','kg-770',1502897910,1),(143,30,'Kutija za skladištenje lanaca','<p>Robusna i lagana plastična kutija s dva pretinca.Za skladištenje lanca za motorne pile i drugih sitnih dijelova.</p>',1,25,NULL,'{}','/uploads/catalog/kutija-d55dd9ad1a.jpg','kutija-za-skladistenje-lanaca',1502898408,1),(144,30,'Rešetka za oštrenje','<p>Pomoćni alat pri brušenju lanca. Alat se učvršćuje na vodilicu pomoću 2 magneta. Linije na pločici pokazuju smjer vođenja turpije pod korektnim kutem.</p>',1,38,NULL,'{}','/uploads/catalog/resetka-70bd44d9b2.jpg','resetka-za-ostrenje',1502898482,1),(145,30,'Set za oštrenje','<p>Višedjelni, robusno uobličen i kvalitetno opremljen set za oštrenje, u praktičnoj i čvrstoj torbici, opremljenoj