tol, bez drški za turpije i turpija.</p>',1,1000,NULL,'{}','/uploads/catalog/fg2-0e8c3c5762.jpg','uredaj-za-ostrenje-fg-2',1502899742,1),(161,30,'Stega za vodilicu','<p>Nova, velika i robusna izvedba. Jednostavno zabijanje u panj, lagano učvršćivanje vodilice, uključena praktična torbica za pojas.</p>',1,120,NULL,'{}','/uploads/catalog/stega-e624878488.jpg','stega-za-vodilicu',1502899828,1),(162,30,'Uređaj za brušenje USG','<p>Univerzalan uređaj za oštrenje lanaca za motorne pile, zajedno sa zidnim ovjesom s mogućnošću zakretanja nosača brusilice pod određenim kutem. Brusne ploče u opremi stroja.</p>',1,3125,NULL,'{}','/uploads/catalog/stihlusg-9be32b9456.jpg','uredaj-za-brusenje-usg',1502899934,1),(163,30,'Uređaj za zakivanje NG 5','<p>Za zakivanje lanaca na motornim pilama.</p>',1,1250,NULL,'{}','/uploads/catalog/ng5-3365ef22d9.jpg','uredaj-za-zakivanje-ng-5',1502900045,1),(164,30,'Uređaj za raskivanje NG 4','<p>Za raskivanje lanaca na motornim pilama.</p>',1,1125,NULL,'{}','/uploads/catalog/ng4-433b49e989.jpg','uredaj-za-raskivanje-ng-4',1502900095,1),(165,30,'Uređaj za raskivanje i nitanje NG 7','<p>Kombinirani uređaj za raskivanje i zakivanje lanaca motornih pila.</p>',1,1875,NULL,'{}','/uploads/catalog/zakivraskiv-6d96e89357.jpg','uredaj-za-raskivanje-i-nitanje-ng-7',1502900142,1),(166,31,'Teleskopska drška','<p>Teleskopska drška od aluminija visoke čvrstoće za povećani doseg pri radu s teleskopskom pilom Super TurboCut. Opremljena steznim elementom i rasterom za kontinuirano namještanje duljine, siguran položaj pod opterčenjem. Dugačka gumirana obloga protiv hladnoće i za siguran prihvat.</p>',1,1150,NULL,'{}','/uploads/catalog/supercut-217865050a.jpg','teleskopska-drska',1502900500,1),(167,31,'Teleskopska drška 320','<p>Bezstupanjski podesivi od 1,75 m do 3,20 m dužine, za rad do 5 m visine.Dvodijelna, jaka aluminijska cijev Ø 30 mm / 27 mm.Ekstremno robustan čelični zatezač, lako dotezanje.Gumirana obloga drške za siguran prihvat.</p>',1,328,NULL,'{}','/uploads/catalog/teledrs-3fa84450e5.jpg','teleskopska-drska-320',1502900688,1),(168,31,'Teleskopska pila PR 40CT','<p>Profesionalna pila za teleskopskom ručkom opremljena listom pile od kromiranog visokoutvrđenog karbonskog čelika. Nazubljenje s razmacima protiv zaglavljivanja. Rezač kore sprječava skidanje dugih traka kore prilikom rezanja, ovjesna kuka protiv spadanja s rezane grane. Opremljena plastičnim štitnikom radi sigurnog i lakšeg skladištenja.</p>',1,758,NULL,'{}','/uploads/catalog/telepila-6f1143a2b5.jpg','teleskopska-pila-pr-40ct',1502900772,1),(169,31,'Potezne škare','<p>Potezne škare za teleskopsku osovinu, vrlo čvrsto metalno kućište, otporne na koroziju. Potezna oštrica reže grane prema dolje, opremljena dvostrukim uležištenjem za lakše svladavanje otpora grane. Škare opremljene poteznim užetom, ručkom na poteznom užetu za lakši rad, te dodatnim vodećim kotačićima za lakši prijenos sile. Masa cca 630g</p>',1,328,NULL,'{}','/uploads/catalog/skare-0c6f0f0694.jpg','potezne-skare',1502900973,1),(170,31,'Pila handycut','<p>16 cm oštrica, promjera 5 cm, 160 g za brzo i precizno rezanje.Trostrano oblikovani zubi japanske geometrije, impulsno utvrđeni, kromirani čelik. Konusni oblik lista pile, ergonomska dvokomponentna ručka, sklopiv list pile zaštićen od korozije.</p>',1,250,NULL,'{}','/uploads/catalog/handy-4af606d859.jpg','pila-handycut',1502901058,1),(171,31,'Ručna pila megacut','<p>Za brzo i precizno piljenje. Trostrani zubi japanske geometrije, utvrđeni kromirani čelik, konusna geometrija lista. Eergonomska dvokomponentna ručka, zaštita od korozije, prihvat pogodan za lijevu ili desnu ruku.</p>',1,475,NULL,'{}','/uploads/catalog/megacut-8e0f8176ea.jpg','rucna-pila-megacut',1502901141,1),(172,31,'Ručna pila','<p>Oštra i trajna račna pila od kaljenog karonskog čelika za šumarstvo, voćarstvo i sl. Lagan rad zbog geometrije zuba i ravnomjerno raspoređenih razmaka. Robusna ručka ergonomskog oblika, bukovina. Duljina lista pile 32 cm.</p>',1,562,NULL,'{}','/uploads/catalog/pila-1aea1d22ef.jpg','rucna-pila',1502901208,1),(173,31,'Škare za živicu PH 10','<p>Za siječu i oblikovanje mekih do tvrdih živica. Posebno obložene oštrice protiv korozije, s nazubljenim rubovima i žlijebom za biljne sokove. Podešavanje oštrica bez alata, ručke od <span style=\"background-color: initial;\">bukovine i prigušivač udaraca kod sklapanja.</span>Duljina 54 cm, težina 1050 g.</p>',1,456,NULL,'{}','/uploads/catalog/ph10-551314798e.jpg','skare-za-zivicu-ph-10',1502901281,1),(174,31,'Futrola za pojas','<p>Za STIHL vrtne škare, kožna, crna.</p>',1,116,NULL,'{}','/uploads/catalog/futrola-e04627a7de.jpg','futrola-za-pojas',1502901352,1),(175,31,'Voćarske škare Bypass','<p>Za rezanje jakih grana. 83 cm, promjer 5 cm, 1695 g. Kovana rezana glava, utori na protuoštrici protiv klizanja grane, žlijeb za biljni sok protiv lijepljenja oštrica. Trajno podmazivanje zgloba, jednostavna izmjena oštrica, gumirane ergonomski oblikovane ručke.</p>',1,950,NULL,'{}','/uploads/catalog/bypass-aae58b9b03.jpg','vocarske-skare-bypass',1502901456,1),(176,31,'Voćarske škare Dynamic','<p>Profesionalne voćarske škare za odsijecanje tvrdog i mrtvog drveta. Zamjenjiva oštrica, premaz protiv lijepljenja.Zamjenjivi nakovanj, utori na siječivu protiv klizanja grane, te kuka za privlačenje grane. Vlačni rez i unutarnji prijenos sile za olakšani rad. Dužina 80 cm, težina 1460 g, promjera 4,8 cm.</p>',1,837,NULL,'{}','/uploads/catalog/dynamic-1a3965ba24.jpg','vocarske-skare-dynamic',1502901818,1),(177,31,'Voćarske škare PB 25','<p>Robusne voćarske škare za udobno odsijcanje tvrdih i odumrlih grana. Premaz noževa sprječava lijepljenje.Podesiv razmak sječiva i nakovnja, zamjenjiv nakovanj.Aluminijske cijevi s ergonomskim ručkama za čvrst prihvat. Dužina 80 cm, težina 1245 g, promjera 4,0 cm.</p>',1,638,NULL,'{}','/uploads/catalog/pb25-d39d53f2bc.jpg','vocarske-skare-pb-25',1502901915,1),(178,31,'Voćarske škare PB 20','<p>Iznimno robusne škare kovanih oštrica sa žlijebom za biljni sok pri sječi zelenih grana. Rezna glava s unutarnjim podmazivanjem uljem, žlijebovi na protuoštrici protiv klizanja grane. Aluminijske cijevi s ergonomski oblikovanim ručkama, ublaživač graničnika sklapanja. Rezna glava iz kovanog visoko kvalitetnog čelika, precizno nabrušena za najfiniji rad.Duljina 750 mm.Masa 1150 g</p>',1,693,NULL,'{}','/uploads/catalog/pb20-b41a798c1b.jpg','vocarske-skare-pb-20',1502902004,1),(179,31,'Voćarske škare PB 11','<p>Iznimno robusne škare kovanih oštrica sa žlijebom za biljni sok pri sječi zelenih grana. Rezna glava s unutarnjim podmazivanjem uljem, žlijebovi na protuoštrici protiv klizanja grane. Aluminijske cijevi s ergonomski oblikovanim ručkama, ublaživač graničnika sklapanja. Rezna glava iz kovanog visoko kvalitetnog čelika, precizno nabrušena za najfiniji rad.Duljina 750 mm.Masa 1150 g</p>',1,450,NULL,'{}','/uploads/catalog/pb11-8dc2108a87.jpg','vocarske-skare-pb-11',1502902083,1),(180,31,'Voćarske škare PB 10','<p>Iznimno robusne škare kovanih oštrica sa žlijebom za biljni sok pri sječi zelenih grana. Rezna glava s unutarnjim podmazivanjem uljem, žlijebovi na protuoštrici protiv klizanja grane. Aluminijske cijevi s ergonomski oblikovanim ručkama, ublaživač graničnika sklapanja. Rezna glava iz kovanog visoko kvalitetnog čelika, precizno nabrušena za najfiniji rad.Duljina 600 mm.Masa 1000 g</p>',1,385,NULL,'{}','/uploads/catalog/pb10-65d5f63dff.jpg','vocarske-skare-pb-10',1502902148,1),(181,31,'Vrtlarske škare PG 25','<p>Jake vrtlarske škare za rezanje tvrdog drveta, plastičnih profila ili crijeva. Lako zamjenjive oštrice s premazom noža protiv lijepljenja.Tijelo škara zaštićeno od korozije, vlačni rez radi uštede snage.</p>',1,210,NULL,'{}','/uploads/catalog/pg25-0f5b6ac73a.jpg','vrtlarske-skare-pg-25',1502902212,1),(182,31,'Vrtlarske škare PG 30','<p>Kromirane vrtlarske škare od kovanog čelika, za obrezivanje zelenila. Lako zamjenjive oštrice, integriran rezač žice. Protuoštrica sa žlijebom za biljni sok. Ergonomski oblikovane ručke s plastičnom oblogom.</p>',1,350,NULL,'{}','/uploads/catalog/pg30-3143477ea1.jpg','vrtlarske-skare-pg-30',1502902260,1),(183,31,'Vrtlarske škare PG 20','<p>Robusne vrtlarske škare od kovanog čelika, univerzalna izvedba. Kromirano tijelo s oštricama koje se mogu naknadno nabrusiti, integriran žlijeb za biljni sok i rezač žice. Ergonomski oblikovane ručke obložene plastikom.</p>',1,200,NULL,'{}','/uploads/catalog/pg-20-bab36c2c72.jpg','vrtlarske-skare-pg-20',1502902327,1),(184,31,'Vrtlarske škare PG 10','<p>Za rezanje i obrezivanje zelenih biljaka. Ručke zaštićene od korozije, praktičan sistem osiguravanja od neželjenog rasklapanja.</p>',1,82,NULL,'{}','/uploads/catalog/pg10-8f9b809441.jpg','vrtlarske-skare-pg-10',1502902428,1),(185,6,'MSA 120 C-BQ','<p>Izuzetno lagana akumulatorska motorna pila za održavanje vrta i okućnice, te za konfekcioniranje ogrjevnog drveta. Opremljena je sustavom brzog napinjanja lanca i kočnicom lanca QuickStop Super. Opremljena je lancem koraka 1/4\" PM3 za uzak i fini rez i odličan rezni učinak. Posebno tiha, ne zahtjeva korištenje zaštite za sluh.&nbsp;</p>',1,1750,NULL,'{\"tezina-kg\":\"2.5\",\"razina-zvucnog-tlaka-db-a\":\"83\",\"razina-zvucne-snage-db\":\"94\",\"razina-vibracija-lijevo-desno-m-s\":\"3.4 \\/ 3.2\",\"tehnologija-baterije\":[\"Litij-ionska\"],\"trajanje-baterije-s-ap-115\":\"\",\"trajanje-baterije-s-ap-115-min\":\"\",\"trajanje-baterije-s-ap-180-min\":\"\",\"trajanje-baterije-s-ap-160-min\":\"\",\"trajanje-baterije-s-ar-900-min\":\"\",\"trajanje-akumulatora-s-ak-10\":\"do 15 min\",\"trajanje-akumulatora-s-ak-20\":\"do 35 min\",\"preporucamo-bateriju\":[\"AK 20\"],\"stihl-lanac-oilomatic-korak\":\"1\\/4 p\",\"stihl-lanac-oliomatic-tip\":\"Picco Micro 3 (PM3)\",\"bez-baterije-i-punjaca\":\"1\",\"sa-ap-200-baterijom-i-sa-punjacem-al-300\":\"0\"}','/uploads/catalog/msa120-9385df9daa.jpg','msa-120-c-bq',1503071267,1),(186,13,'HSA 56','<p>Lagane akumulatorske škare za živicu, odlične snage rezanja za trimanje i šišanje žive ograde oko naših kuća. Iznimno tihe i jednostavne za korištenje, ne zahtjevaju upotrebu zaštite sluha. Sustav noževa uobličen za rezanje grana u oba smjera. Vrhovi češlja u obliku kapljice osiguravaju granje od isklizavanja</p>',1,1562,NULL,'{\"tezina-bez-akumulatora-kg\":\"2.9\",\"razina-zvucnog-tlaka-dba\":\"80\",\"razina-zvucne-snage-dba\":\"91\",\"razina-vibracija-lijevo-desno-m-s\":\"2.7 \\/ 1.2\",\"preporuceni-akumulator\":\"AK 10\",\"vrsta-akumulatora\":\"Litij-ion\",\"trajanje-baterije-s-ap-80-min\":\"\",\"trajanje-baterije-s-ap-115-min\":\"\",\"trajanje-baterije-s-ap-120-min\":\"\",\"trajanje-baterije-s-ap-160-min\":\"\",\"trajanje-baterije-s-ap-180-min\":\"\",\"trajanje-baterije-s-ar-900-min\":\"\",\"rezna-duljina-cm\":\"45\",\"broj-okretaja-1min\":\"\",\"ukupna-duljina-cm\":\"94\",\"razmak-zuba-mm\":\"30\",\"debljina-granepresjeka-mm\":\"\",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\",\"bez-baterije-i-punjaca\":\"1\"}','/uploads/catalog/hsa56-1d01ff67f7.jpg','hsa-56',1503071437,1),(187,33,'BGA 45','<p>Praktičan akumulatorski puhač za čišćenje manjih brisanih površina na okućnici. Okrugli otvor cijevi za puhanje, integrirana akumulatorska baterija s LED indikatorom napunjenosti. Težina 2,0 kg. vrijeme punjenja akumulatora 210 min/300 min (80 %/100 %)</p>',1,999,NULL,'{\"vrsta-akumulatora\":\"Litij-ion\",\"tezina-bez-akumulatora-kg\":\"2\",\"razina-zvucnog-tlaka-dba\":\"76\",\"razina-zvucne-snage-dba\":\"87\",\"snaga-puhanja-n\":\"5\",\"brzina-puhanja-ms\":\"38\",\"protok-zraka-m3h\":\"420\",\"maksimalna-brzina-zraka-ms\":\"44\",\"maksimalni-protok-zraka-m3h\":\"42\",\"trajanje-akumulatora-min\":\"do 10 min\",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\"}','/uploads/catalog/bga45-dc7fd12adc.jpg','bga-45',1503071767,1),(188,33,'FSA 45','<p>Kompaktni akumulatorski trimer za košnju i čišćenje travnjaka na prostorima okućnice.Integrirana akumulatorska baterija s pokazivačem napunjenosti, bezalatno podešavanje duljine osovine i kuta prihvatne ručke. Podesiv kut reznog alata te uzdužnog kuta ručke za vertikalno rezanje rubova travnjaka. Integriran odstojnik za savršenu kontrolu radnog opsega uređaja.&nbsp;</p>',1,999,NULL,'{\"vrsta-akumulatora\":\"Litij-ion\",\"tezina-bez-akumulatora-kg\":\"2.3\",\"razina-zvucnog-tlaka-dba\":\"77\",\"razina-zvucne-snage-dba\":\"87\",\"snaga-puhanja-n\":\"\",\"brzina-puhanja-ms\":\"\",\"protok-zraka-m3h\":\"\",\"maksimalna-brzina-zraka-ms\":\"\",\"maksimalni-protok-zraka-m3h\":\"\",\"trajanje-akumulatora-min\":\"do 15 \",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\"}','/uploads/catalog/fsa45-63b4b9b3aa.jpg','fsa-45',1503071995,1),(189,33,'HSA 45','<p>Lagane aku-škare odličnog radnog učinka za trimanje ukrasnog grmlja i rezanje granja žive ograde na okućnici. Jednostrano brušeni noževi, integrirana zaštita rezne garniture. Opremljena integriranim akumulatorom s LED indikatorom napunjenosti.&nbsp;</p>',1,999,NULL,'{\"vrsta-akumulatora\":\"Litij-ion\",\"tezina-bez-akumulatora-kg\":\"2.3\",\"razina-zvucnog-tlaka-dba\":\"54\",\"razina-zvucne-snage-dba\":\"77\",\"snaga-puhanja-n\":\"\",\"brzina-puhanja-ms\":\"\",\"protok-zraka-m3h\":\"\",\"maksimalna-brzina-zraka-ms\":\"\",\"maksimalni-protok-zraka-m3h\":\"\",\"trajanje-akumulatora-min\":\"do 40\",\"ovisno-o-zemlji-trzista-moguca-su-odstupanja-u-asortimanu-i-navedenim-podacima-takoder-su-moguce-izmjene-u-tehnici-izvedbe-cijeni-i-dodatnoj-opremi\":\"1\"}','/uploads/catalog/hsa45-69ecb5710f.jpg','hsa-45',1503072108,1);
