INSERT INTO `easyii_pages` VALUES (1,'Index','<p><strong>STIHL Ovlašteno prodajni centar u Gradu Krku</strong></p><p>Temelj našeg poslovanja je profesionalna prodajno-servisna usluga. Uz STIHL i VIKING programe činimo naše kupce sretnima i zadovoljnima dugi niz godina kako u prodaji tako i u servisu. Trudimo se dugi niz godina da kupcima pomognemo oko izbora optimalnih uređaja za njihov rad te da ih taj uređaj iz dana u dan veseli što više; bilo da je to na Benzinska goriva ili Električna, Akumulatorska energija nije važno, važno je da je naš kupac uvijek zadovoljan&nbsp;sa našom uslugom,prodajom te svojim izborom.</p><p>Servisno-trgovački centar u Ogulinu ovlašteni STIHL&amp;VIKING servis trudi se što više zadovoljiti kupce kojima je potrebna servisna pomoć oko njihovog uređaja.</p><p>Našim znanjem do vašeg STIHL&amp;VIKING uređaja.</p>','page-index'),(2,'Shop','','page-shop'),(3,'Shop search','','page-shop-search'),(4,'Shopping cart','','page-shopcart'),(5,'Order created','<p>Your order successfully created. Our manager will contact you as soon as possible.</p>','page-shopcart-success'),(6,'Novosti','','page-news'),(7,'Articles','','page-articles'),(8,'Galerija','','page-gallery'),(9,'Guestbook','','page-guestbook'),(10,'FAQ','','page-faq'),(11,'Kontakt','<p><strong>Sjedište</strong>: Josipa Blaževića Blaža 15, Skrad 51311 HRVATSKA</p><p><strong>Prodavaonica Krk</strong>: Zagrebačka 18, Krk 51500 HRVATSKA</p><p><strong>Telefon/ Fax</strong>: 051/ 220-330</p><p><strong>E-mail</strong>: krk@zaga-racki.hr</p><p><strong>Radno vrijeme</strong>: <strong>LJETNO</strong> Pon. - Pet. 8-13h,&nbsp; 18-20h &nbsp;&nbsp;Sub. 8-13h</p><p style=\"margin-left: 100px;\">&nbsp;&nbsp;<strong>ZIMSKO</strong> Pon. - Pet. 8-13h, 17-19h &nbsp; &nbsp;Sub. 8-13h&nbsp;</p><p style=\"margin-left: 100px;\"></p>','page-contact');
